import React from 'react'
import { ACTION } from './App'

function OperationButton({dispatch,operation}) {
  return (
    <button onClick={()=>{
      dispatch({type:ACTION.CHOOSE_OPERATION,payload:{operation}})
    }}>{operation}</button>
  )
}

export default OperationButton
